import Navtop from './Navtop';
import{ useState } from 'react';
import './navbar.css';
import {IconContext} from 'react-icons'
import { BsBell , BsChatDots , BsCalendar , BsThreeDots} from "react-icons/bs";
import { HiOutlineUserGroup , HiOutlineShoppingBag } from "react-icons/hi";
import { IoCallOutline , IoHelpCircleSharp , IoHelpCircleOutline } from "react-icons/io5";
import { AiOutlineFile , AiOutlineAppstoreAdd } from "react-icons/ai";

function Navbar(){
    function NavHandler(event){
        event.target.classList.add('.active')
    }
    return(
        <IconContext.Provider value={ {color:"white" , size:"1.3em"} }>
            <div className='Navbar-wrapper'>
            <div className='Navbar-topitem'>


            </div>
            <div className='Navbar-bottomitem'>
                <Navtop icon={<AiOutlineAppstoreAdd/>} title='Apps'/>
                <Navtop icon={<IoHelpCircleOutline/>} title='Help'/>


            </div>

        </div>
        </IconContext.Provider>

    );
}

export default Navbar;
